import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { InstalmentComponent } from './instalment.component';
import { InstalmentRoutingModule } from 'app/payment/instalment/route/instalment-routing.module';
import { DialogModule } from 'primeng/dialog';
import { SharedModule } from 'app/shared/shared.module';
import { PanelModule } from 'primeng/panel';
import { DropdownModule } from 'primeng/dropdown';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { InputTextModule } from 'primeng/inputtext';
import { MultiSelectModule } from 'primeng/multiselect';
import { TableModule } from 'primeng/table';
import { ButtonModule } from 'primeng/button';
import { ConfirmPopupModule } from 'primeng/confirmpopup';
import { ToastModule } from 'primeng/toast';
import { TagModule } from 'primeng/tag';
import { RippleModule } from 'primeng/ripple';
import { DataEntryService } from 'app/workload/payroll-verifier/data-entry/service/data-entry.service';
import { ConfirmationService, MessageService } from 'primeng/api';
import { DateUtilsService } from 'app/core/util/date-utils.service';
import { DialogService } from 'primeng/dynamicdialog';
import { NspConfirmationService } from 'app/shared/confirm/nsp-confirm.service';
import { InstalmentTerminateComponent } from './instalment-terminate/instalment-terminate.component';
import { InstalmentViewComponent } from './instalment-view/instalment-view.component';
import { InstalmentCreateComponent } from './instalment-create/instalment-create.component';
import { InputNumberModule } from 'primeng/inputnumber';
import { InstalmentApprovalComponent } from './instalment-approval/instalment-approval.component';
import {
  InstalmentTerminateApprovalComponent
} from './instalment-terminate-approval/instalment-terminate-approval.component';
import { InstalmentEditRejectedComponent } from './instalment-edit-rejected/instalment-edit-rejected.component';
import { InstalmentCreateGenerateEmailComponent } from './instalment-create-generate-email/instalment-create-generate-email.component';
import {ClipboardModule} from "ngx-clipboard";
import { IcCodeService } from 'app/ng-connect';
import { ParamService } from 'app/ng-connect/param/param.service';
import { FileUploadService } from 'app/shared/service/file-upload.service';


@NgModule({
  declarations: [
    InstalmentComponent,
    InstalmentTerminateComponent,
    InstalmentViewComponent,
    InstalmentCreateComponent,
    InstalmentApprovalComponent,
    InstalmentTerminateApprovalComponent,
    InstalmentEditRejectedComponent,
    InstalmentCreateGenerateEmailComponent
  ],
  imports: [
    ClipboardModule,
    InstalmentRoutingModule,
    CommonModule,
    SharedModule,
    DialogModule,
    PanelModule,
    DropdownModule,
    FormsModule,
    ReactiveFormsModule,
    InputTextModule,
    MultiSelectModule,
    TableModule,
    ButtonModule,
    ConfirmPopupModule,
    ToastModule,
    TagModule,
    RippleModule,
    InputNumberModule
  ],
  exports: [
    InstalmentTerminateComponent
  ],
  providers: [
    DataEntryService, ConfirmationService, MessageService, 
    DateUtilsService, DialogService, NspConfirmationService, IcCodeService,
    FileUploadService]

  })
export class InstalmentModule {
}
